import "../Styles/hero.css";
import "../Styles/container.css";
import image from "../Images/onnin_kuva_uusin.png";

const Hero = () => {
    return (
        <div className='container'>
        <div className='hero'>
            <div className='hero-text'>
                <div>
                    <h1>Onni Virtanen</h1>
                    <p>
                    Software Engineering student from Jyväskylä. I am actively seeking job opportunities and am keen to learn and grow professionally.
                    </p>
                </div>
            </div>
            <img src={image} alt="Photo of Onni Virtanen" className='image-of-onni'/>
        </div>
        </div>
    )
}

export default Hero;
